DROP TABLE IF EXISTS `sys_application`;
CREATE TABLE `sys_application` (
  `id` bigint(40) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `name` varchar(200) NOT NULL COMMENT '应用名称',
  `icon` varchar(200) NOT NULL COMMENT '应用图标',
  `simple` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否透明（1：透明，0：不透明）',
  `resize` tinyint(4) NOT NULL DEFAULT '0' COMMENT '调整大小（1：可以，0：不可以）',
  `height` varchar(200) NOT NULL DEFAULT '300' COMMENT '窗口高度',
  `width` varchar(200) NOT NULL DEFAULT '300' COMMENT '窗口宽度',
  `app_url` varchar(1000) NOT NULL COMMENT '访问路径',
  `authorize` tinyint(4) NOT NULL COMMENT '是否授权',
  `remark` varchar(1000) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='应用';

